Il blu prenderà forma per dare dimora ad un sogno, una nuova prospettiva per #MET2B, una nuova forma. È la visione dell'artista #SandroBracchitta, che reinterpreterà la facciata del #MET, la "grande tela" pronta ad accogliere l'opera del noto maestro incisore.
Vi aspettiamo domenica 30 giugno alle ore 19:00 per perdervi in questo sogno, "un sogno nel blu". • • • • • • • • • 
